Have you ever seen dolphins on the high seas? 🐬⠀⠀
⠀⠀
This was perhaps the most important impression from my trip to the Maldives. Next to the dolphins, you seem to be returning to the origins of existence. As if you were a child again and forget about all the problems of the modern world! Dolphins on the high seas are really free. Watching them, you are charged with their energy and a sense of joy of the moment of life. That's magic! 😍⠀
